export default function History() {
  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold">Historial de Localizaciones</h2>
      <p className="text-gray-300 mt-2">
        Aquí irá el historial cada 15 minutos.
      </p>
    </div>
  );
}
